import base64
import io
from PIL import Image

import requests

PRECISION = 0.99

def decode_img(msg):
    msg = base64.b64decode(msg)
    buf = io.BytesIO(msg)
    img = Image.open(buf)
    return img

def get_letters(img):
    letters = [[]]
    w, h = img.size
    for i in range(w):
        row = [img.getpixel((i, j)) for j in range(h)]
        row = [0 if x[0] < 128 else 1 for x in row]
        white_pxs = sum(row)

        if white_pxs != h:
            letters[-1].extend([str(x) for x in row])
        else:
            if letters[-1]:
                letters.append([])
    letters = [x for x in letters if x]
    return letters[:]

def cmp(letter, abc):
    possible_keys = set()
    for key in abc.keys():
        common_l = max(len(key), len(letter))
        i1 = letter.ljust(common_l, "1")
        i2 = key.ljust(common_l, "1")
        count = sum(1 if i1[i] == i2[i] else 0 for i in range(common_l))
        if count / common_l > PRECISION:
            possible_keys.add(abc[key])
    possible_keys = list(possible_keys)
    if (possible_keys):
        print("Keys: ", possible_keys)
        return possible_keys[0]
    return None


